import React, { useState } from 'react';

const CommunityPage = () => {
  const [selectedPhoto, setSelectedPhoto] = useState(null);

  const handlePhotoClick = (photo) => {
    setSelectedPhoto(photo);
  };

  return (
    <div>
      {/* ... existing code ... */}
      <div className="header">Community</div>
      <div className="gallery">
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/f/f1/Procyon_lotor_qtl2.jpg"
          alt="Image 1"
          className={selectedPhoto === 'image1.jpg' ? 'selected' : ''}
          onClick={() => handlePhotoClick('image1.jpg')}
        />
        <img
          src="https://planet-vie.ens.fr/sites/default/files/pages/mig/Manchot%20empereur_CC-BY-SA_Samuel%20Blanc_Wikimedia.jpg"
          alt="Image 2"
          className={selectedPhoto === 'image2.jpg' ? 'selected' : ''}
          onClick={() => handlePhotoClick('image2.jpg')}
        />
        <img
          src="https://st4.depositphotos.com/1762405/23585/i/600/depositphotos_235852676-stock-photo-dove-interesting-looks-into-the.jpg"
          alt="Image 3"
          className={selectedPhoto === 'image3.jpg' ? 'selected' : ''}
          onClick={() => handlePhotoClick('image3.jpg')}
        />
      </div>
      {selectedPhoto && (
        <div className="selected-photo">
          <img src={selectedPhoto} alt="Selected Image" className="selected-image" />
          <div className="caption">Caption for the selected photo</div>
        </div>
      )}
    </div>
  );
};

export default CommunityPage;
